    // Get the API key from the environment variable
    let api_key = env::var("ELEVENLABS_API_KEY").expect("ELEVENLABS_API_KEY must be set");

    // Create an instance of the ElevenLabs API client
    let client = ElevenLabs::new(api_key);

    // Get the contents of the clipboard
    let mut ctx = ClipboardContext::new().expect("Failed to create clipboard context");
    let contents = ctx.get_contents().expect("Failed to get clipboard contents");

